import React, { useEffect,useState } from 'react';

const TableData = () => {
   
    const [show,setShow]=useEffect
    let user="sbcd";
    useEffect(() => {
        
        fetch('/about')
            .then(res => res.json())
            .then(async (data) => {
                await console.log(data)
                console.log('done')

                const users=(data);
                user=users;
            })
    }, []);

    return (

        <>
            <h1>{user}</h1>
        </>
    );
};

export default TableData;
